import React, { useEffect, useState } from "react";

// components

import CardTable from "components/Cards/CardTable.js";
import Axios from "axios";
import BootstrapTable from 'react-bootstrap-table-next';
import paginationFactory from 'react-bootstrap-table2-paginator';
import { profile } from "reducers/profile";
const Tables = () => {
  function list (listProfile){
    var result=[]
    var i;
    for (i of  listProfile){
      let id = i.id;
      let username=i.user.username;
      let fistname = i.fistname;
      let lastname = i.lastname;
      let phonenum = i.phonenum;
      let address = i.address;
      let cmmd = i.cmmd;
      let l = {
        "username":username,
        "fistname" :fistname,
        "lastname":lastname,
        "phonenum":phonenum,
        "address":address,
        "cmmd":cmmd

      };
      result.append(l);
    }
    return result;
  }
  const [listProfile,setlistProfile] = useState([])
  const getlistProfile = async () => {
    try {
      const data = await Axios.get(
        "http://127.0.0.1:8000/api/auth/profile/1"
      );
      setlistProfile(data.data);
    }
    catch(e){
      console.log(e)
    }
  }
  useEffect(()=>{
    getlistProfile(),
    listProfile=list(listProfile)
  },[]);

  const columns = [
    {dataField: "id", text: "Id"},
    {dataField: "user", text: "User Name"},
    {dataField: "fistname", text: "First Name"},
    {dataField: "lastname", text: "Last Name"},
    {dataField: "phonenum", text: "Phone number"},
    {dataField: "address", text: "Address"},
    {dataField: "cmmd", text: "CMND"},
  ]
  return (
    <>
      <div className="flex flex-wrap mt-4">
        <div className="w-full mb-12 px-4">
          <BootstrapTable
            keyField="id"
            data={listProfile}
            columns={columns}
            pagination= {paginationFactory()} />
        </div>

      </div>
    </>
  );
}
export default Tables;
